      type="text"
      placeholder="Result"
      id="result"

      /> <br /><br />
      <button onClick={() => add()}>Add</button> &nbsp;
      <button onClick={() => sub()}>Sub</button> &nbsp;
      <button onClick={() => mul()}>Mul</button> &nbsp;
      <button onClick={() => div()}>Div</button> 
    </div>
  );
}

export default App;
